import React from 'react'
import { Link } from 'react-router-dom'
const Navbar = () => {
    return (
        <nav className='nav-wrapper gray draken-3'>
            <div className='container'>
                <Link to='/' className='brand-logo'>Plan</Link>
            </div>
        </nav>
    )
}
export default Navbar
